        </Link>
    		<div className="row">
          <div className="col-sm-6 text-secondary">
            Instructor: {this.props.instructor}
          </div>
          <div className="col-sm-6 text-secondary">
            Meeting day: {this.props.meetingDay}
          </div>
        </div>
    	</div>
    );
  }
}

export default ClassList;
